import React from "react";

function PostButton({ onClick, id, name, text, likes, dislikes }) {
    const handleClick = () => {
        // Call the onClick function with the specified properties
        onClick({ id, name, text, likes, dislikes });
    };

    return (
        <button type="button" onClick={handleClick}>
            Post
        </button>
    );
}

export default PostButton;
